const React =require('react');
const DefaultLayout = require('./Layout');
const main =require('../public/src/js/main');

function Index(props){



    return(
        <DefaultLayout title={props.title} >
    <div className="container">
      <div className="row">
        <div className="col-4"></div>
        <div className="col-4">
          <img src="/public/src/img/Exito.png"/>
        </div>
        <div className="col-4"></div>
      </div>
      <div className="row">
        <div className="col-4">
         <div className="row">

          <label htmlFor="User">Usuario:</label><br/>
          <input type="text" name="User" id="User" required/><br/>
          <label htmlFor="Password">Contraseña:</label><br/>
          <input type="password" name="Password" id="Password" required/><br/>

         </div>
          <div className="row">
            <i className="boton light-green"  id="btn_login" onClick={login()}>ingresar</i>
          </div>
        </div>
      </div>
      </div>
      <script src="/main"></script>

        </DefaultLayout>
    )
}


function login(){
  const _user=document.getElementById('User').value;
  const _password=document.getElementById('Password').value;
  console.log(_user,_password);
}


module.exports=Index;

